import React from 'react';

class RestaurantInfo extends React.Component {
  constructor(props) {
    super(props);

  }


  render(){
    return(
      <div class="flex flex-col bg-blue-400 justify-center items-center">
        <div><span>{this.props.data.name}</span></div>
        <div><span>{this.props.data.address}</span></div>
        <div><span>{this.props.data.phone}</span></div>
        <div>
          <span>Mon: {this.props.data.hours.mon}</span></div>
      </div>
    )
  }
}

export default RestaurantInfo;
